svg.script:
document.querySelectorAll("path").forEach(path => {
    path.addEventListener("click", function () {
        const pathId = path.id || "(без id)";
        const length = path.getTotalLength();
        let points = [];

        for (let i = 0; i <= length; i += 1) {
            const { x, y } = path.getPointAtLength(i);
            points.push({ x, y });
        }

        if (points.length < 3) {
            alert(`Path ID: ${pathId}\nНе хватает точек для вычисления площади`);
            return;
        }

        console.log(`Path ID: ${pathId}`);
        console.log("Координаты точек:", points);
        console.log(`Количество точек: ${points.length}`);

        let area = 0;
        for (let i = 0; i < points.length - 1; i++) {
            area += (points[i].x * points[i + 1].y) - (points[i + 1].x * points[i].y);
        }
        area = Math.abs(area) / 2;
        area = area / 5.24382628733;

        console.log(`Площадь: ${area.toFixed(2)} м²`);

        // Показываем alert до рисования линий
        alert(`Path ID: ${pathId}\nПлощадь: ${area.toFixed(2)} м²\nКоличество точек: ${points.length}`);

        const svgNS = "http://www.w3.org/2000/svg";
        const svg = document.createElementNS(svgNS, "svg");
        const parentSvg = path.ownerSVGElement;
        svg.setAttribute("width", parentSvg.getAttribute("width"));
        svg.setAttribute("height", parentSvg.getAttribute("height"));
        svg.style.position = "absolute";
        svg.style.top = "0";
        svg.style.left = "0";
        svg.style.pointerEvents = "none";
        parentSvg.appendChild(svg);

        // Создаем одну линию
        const line = document.createElementNS(svgNS, "line");
        line.setAttribute("stroke-width", "10");
        svg.appendChild(line);

        // Функция для генерации случайного цвета
        function getRandomColor() {
            const letters = "0123456789ABCDEF";
            let color = "#";
            for (let i = 0; i < 6; i++) {
                color += letters[Math.floor(Math.random() * 16)];
            }
            return color;
        }

        // Функция для перемещения линии
        function drawLine() {
            let i = 0;

            function moveLine() {
                if (i < points.length) {
                    line.setAttribute("x1", points[i].x);
                    line.setAttribute("y1", points[i].y);
                    line.setAttribute("x2", i === points.length - 1 ? points[0].x : points[i + 1].x);
                    line.setAttribute("y2", i === points.length - 1 ? points[0].y : points[i + 1].y);
                    line.setAttribute("stroke", getRandomColor()); // Меняем цвет
                    i++;
                    setTimeout(moveLine, 20); // Задержка 10 мс
                } else {
                    // Удаляем SVG после завершения
                    setTimeout(() => {
                        parentSvg.removeChild(svg);
                    }, 100);
                }
            }

            moveLine();
        }

        drawLine();
    });
});
